import React from "react";
import ImageWithText from '../components/LandingClickable';
import RainyImage from '../assets/RainyWindowAboutUs.png';

const Landing = () => {
  return (
    <div className="body-content-area">
        <ImageWithText
        imageUrl={RainyImage}
        altText="NOT OK"
        caption="About Us"
        linkUrl="/about"
        />
        <ImageWithText
        imageUrl={RainyImage}
        altText="NOT OK"
        caption="Data Findings"
        linkUrl="/about"
        />
        <ImageWithText
        imageUrl={RainyImage}
        altText="NOT OK"
        caption="Top 10 Most Dangerous Roads"
        linkUrl="/about"
        />
        <ImageWithText
        imageUrl={RainyImage}
        altText="NOT OK"
        caption="Live Map"
        linkUrl="/about"
        />
        <ImageWithText
        imageUrl={RainyImage}
        altText="NOT OK"
        caption="Machine Learning Maps"
        linkUrl="/about"
        />
    </div>
  );
};
  
export default Landing;
